import React, {Component} from 'react';
import $ from 'jquery';
import {connect} from 'react-redux';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';
import Header from '../Header/Header.js';
import CurrentTrainings from '../CurrentTrainings/CurrentTrainings.js';
import CompletedTrainings from '../CompletedTrainings/CompletedTrainings.js';

function mapStateToProps(state, props) {
    return {
      userId: state.userId
    };
}

class Mentor extends Component {
  constructor(props) {
    super(props);

    this.state = {
      redirect: {
        flag: false,
        path: '/login'
      }
    };
    if(!this.props.userId) {
      this.state.redirect.flag = true;
    }

  }

  componentDidMount() {
  }

  componentDidUpdate() {
  }

  render() {
    return (
      <div class="mentor-container">
        <Header/>
        <div class="tabs-container">
          <Tabs>
            <TabList>
              <Tab>Current Trainings</Tab>
              <Tab>Edit Skills</Tab>
              <Tab>Completed Trainings</Tab>
              <Tab>Notifications</Tab>
            </TabList>

            <TabPanel>
              <CurrentTrainings/>
            </TabPanel>
            <TabPanel>
              <h5>Edit Skills</h5>
            </TabPanel>
            <TabPanel>
              <CompletedTrainings/>
            </TabPanel>
            <TabPanel>
              <h5>Notifications</h5>
            </TabPanel>
          </Tabs>
        </div>
      </div>
    );
  }
}
export default Mentor;
